en'),(1146,573,'en','2023-09-06 11:21:41.041027','2023-12-01 19:22:21.624106','Selected text passages'),(1147,574,'de','2023-09-06 11:21:41.045335','2023-09-06 11:21:57.648804','mit dt. Übersetzung'),(1148,574,'en','2023-09-06 11:21:41.048892','2023-09-06 11:21:41.048892','with German translation'),(1149,575,'de','2023-09-06 11:21:41.053243','2023-09-06 11:21:57.653121','Import von Fotos'),(1150,575,'en','2023-09-06 11:21:41.056919','2025-01-29 16:28:59.907412','Import photos'),(1151,576,'de','2023-09-06 11:21:41.069619','2023-09-06 11:21:57.657942','Import von Metadaten'),(1152,576,'en','2023-09-06 11:21:41.073406','2023-09-06 11:21:41.073406','Bulk Metadata Import'),(1153,577,'de','2023-09-06 11:21:41.077942','2023-09-06 11:21:57.662710','Import von Registereinträgen'),(1154,577,'en','2023-09-06 11:21:41.081429','2023-09-06 11:21:41.081429','Import of Registry Entries'),(1155,578,'de','2023-09-06 11:21:41.085769','2023-09-06 11:21:41.085769',NULL),(1156,578,'en','2023-09-06 11:21:41.089296','2023-09-06 11:21:41.089296','Für einen erfolgreichen Import der Textdateien müssen diese in einer zip-Datei ohne Unterordner komprimiert werden. Die Dateinamen müssen dem Muster Archiv-ID_Typ_Sprache.ext folgen, wobei der Typ für Biographien \'bg\' und für Protokolle \'prot\' lautet. Beispiel: za123_prot_de.rtf oder za007_bg_de.odt.'),(1157,579,'de','2023-09-06 11:21:41.093567','2023-09-06 11:21:57.667829','Import von Textdateien (Protokolle oder Biografien)'),(1158,579,'en','2023-09-06 11:21:41.097076','2023-09-06 11:21:41.097076','Bulk Text Import (protocolls and biographies)'),(1159,580,'de','2023-09-06 11:21:41.101334','2023-09-06 11:21:57.680548','Wähle zuerst was du  importieren möchtest.'),(1160,580,'en','2023-09-06 11:21:41.104759','2023-12-07 18:04:32.126026','First select what you want to import.'),(1161,581,'de','2023-09-06 11:21:41.117130','2023-09-06 11:21:57.685052','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere sie als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Bitte beachte, dass der Dateiname in der Importdatei in Groß-/Kleinschreibung genau dem zu importierenden Dateinamen entsprechen muss. Dies betrifft auch die Dateiendung: .jpg, .JPG, .jpeg etc. sind unterschiedliche Benennungen. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein. Komprimiere die csv-Datei zusammen mit den Fotos in eine zip-Datei und lade sie hoch (keine Unterordner in der zip-Datei!).'),(1162,581,'en','2023-09-06 11:21:41.120593','2025-01-29 16:24:23.251733','Download the import template, import your data, save it as a csv file and upload it. Retain the number and names of the columns as well as the field type. Please note that the file name in the import file must correspond exactly to the file name to be imported in upper/lower case. This also applies to the file extension: .jpg, .JPG, .jpeg etc. are different names. Language descriptions should either be in English or in Alpha2 or Alpha3 code. Delimiters should be either semicolon or tab. Compress the csv file together with the photos into a zip file and upload it (no subfolders in the zip file!).'),(1163,582,'de','2023-09-06 11:21:41.124908','2023-09-06 11:21:57.690036','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein.'),(1164,582,'en','2023-09-06 11:21:41.128346','2023-09-06 11:21:41.128346','Download this spreadsheet template, fill in your data, save as csv and upload. Keep column number and names as well as field types. Languages should be given in english or in alpha2- or alpha3-codes. Use semicolon or tab as delimiter.'),(1165,583,'de','2023-09-06 11:21:41.132614','2023-09-06 11:21:57.694830','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Delimiter sollten entweder Semikolon oder Tab sein.'),(1166,583,'en','2023-09-06 11:21:41.136057','2023-09-06 11:21:41.136057','Download this spreadsheet template, fill in your data, save as csv and upload. Keep column number and names as well as field types. Use semicolon or tab as delimiter.'),(1167,584,'de','2023-09-06 11:21:41.140273','2023-09-06 11:21:57.699549','Komprimiere deine Protokoll- oder Biografietextdateien in eine zip-Datei und lade sie hoch (die Textdateien müssen flach in der zip-Datei liegen, also keine Unterordner!). Dateinamen müssen dem Muster Interview-ID_Typ_Sprache.ext folgen, wobei der Typ für Biographieen \'bg\' und für Protokolle \'prot\' ist. Z.B. za123_prot_de.rtf oder za007_bg_de.odt.'),(1168,584,'en','2023-09-06 11:21:41.151973','2023-09-06 11:21:41.151973','Compress your protocoll- or biography-files into a zip file and upload. No subfolders in the zip-archive allowed. File names must be like InterviewID_Type_Language.ext, where type is \'bg\' for biographies and \'prot\' for protocolls. E.g. za123_prot_de.rtf or za007_bg_de.odt.'),(1169,585,'de','2023-09-06 11:21:41.156277','2023-09-06 11:21:57.703889','Es können Transkripte in den Formaten .csv, .ods, .odt, .vtt, .srt hochgeladen werden. Im .csv- und .ods-Format müssen die Spalten mit \'In|Timecode\', \'Speaker|Sprecher\' und \'Trans[c|k]ript|Translation|Übersetzung\' betitelt werden. Dateien im .odt-Format sollten nur den Transkripttext (inkl. Sprecher*innenauszeichnungen) ohne Header, Footer oder anderen Text enthalten.'),(1170,585,'en','2023-09-06 11:21:41.159634','2024-07-29 17:27:21.330166','Transcripts can be uploaded in the formats .csv, .ods, .odt, .vtt, .srt. In .csv and .ods format, the columns must be titled \'In|Timecode\', \'Speaker|Speaker\' and \'Trans[c|k]ript|Translation|Translation\'. File