lade sie hoch (die Textdateien müssen flach in der zip-Datei liegen, also keine Unterordner!). Dateinamen müssen dem Muster Interview-ID_Typ_Sprache.ext folgen, wobei der Typ für Biographieen \'bg\' und für Protokolle \'prot\' ist. Z.B. za123_prot_de.rtf oder za007_bg_de.odt.'),(4061,585,'ru','2023-09-06 11:22:08.599683','2024-07-29 17:27:21.331723','Transcripts can be uploaded in the formats .csv, .ods, .odt, .vtt, .srt. In .csv and .ods format, the columns must be titled \'In|Timecode\', \'Speaker|Speaker\' and \'Trans[c|k]ript|Translation|Translation\'. Files in .odt format should only contain the transcript text (including speaker markups) without headers, footers or other text.'),(4062,586,'ru','2023-09-06 11:22:08.605378','2023-09-06 11:22:08.605378','Nutzeransicht'),(4063,587,'ru','2023-09-06 11:22:08.611644','2023-09-06 11:22:08.611644','редакторский формат'),(4064,588,'ru','2023-09-06 11:22:08.617875','2023-09-06 11:22:08.617875','Регистрация'),(4065,589,'ru','2023-09-06 11:22:08.624162','2023-09-08 10:18:35.917344','Пожалуйста, зарегистрируйтесь для получения доступа к интервью.'),(4066,590,'ru','2023-09-06 11:22:08.630345','2023-09-09 10:46:08.842032','Пожалуйста, зарегистрируйтесь для получения доступа к платформе. '),(4067,591,'ru','2023-09-06 11:22:08.636844','2023-09-08 10:22:02.315076',' содержат пояснение, кто и с какой целью может использовать Oral.History-Digital. '),(4068,592,'ru','2023-09-06 11:22:08.643066','2023-09-09 10:49:11.692529',' поясняет, почему мы запрашиваем некоторые данные и для чего их используем. В целях защиты информации Вы получите электронное письмо с просьбой подтвердить Вашу регистрацию. '),(4069,593,'ru','2023-09-06 11:22:08.659409','2023-09-06 11:22:08.659409','После этого Вы сможете подать запрос на активацию допуска к различным архивам интервью, размещенным на платформе.'),(4070,594,'ru','2023-09-06 11:22:08.666145','2023-09-08 10:19:54.176139','Условия пользования'),(4071,595,'ru','2023-09-06 11:22:08.672719','2023-09-0