select what you want to import.'),(6303,581,'el','2023-09-06 11:22:23.092793','2023-09-06 11:22:23.092793','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere sie als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Bitte beachte, dass der Dateiname in der Importdatei in Groß-/Kleinschreibung genau dem zu importierenden Dateinamen entsprechen muss. Dies betrifft auch die Dateiendung: .jpg, .JPG, .jpeg etc. sind unterschiedliche Benennungen. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein. Komprimiere die csv-Datei zusammen mit den Fotos in eine zip-Datei und lade sie hoch (keine Unterordner in der zip-Datei!).'),(6304,582,'el','2023-09-06 11:22:23.098033','2023-09-06 11:22:23.098033','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein.'),(6305,583,'el','2023-09-06 11:22:23.103220','2023-09-06 11:22:23.103220','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Delimiter sollten entweder Semikolon oder Tab sein.'),(6306,584,'el','2023-09-06 11:22:23.108341','2023-09-06 11:22:23.108341','Komprimiere deine Protokoll- oder Biografietextdateien in eine zip-Datei und lade sie hoch (die Textdateien müssen flach in der zip-Datei liegen, also keine Unterordner!). Dateinamen müssen dem Muster Interview-ID_Typ_Sprache.ext folgen, wobei der Typ für Biographieen \'bg\' und für Protokolle \'prot\' ist. Z.B. za123_prot_de.rtf oder za007_bg_de.odt.'),(6307,585,'el','2023-09-06 11:22:23.121272','2024-07-29 17:27:21.332784','Transcripts can be uploaded in the formats .csv, .ods, .odt, .vtt, .srt. In .csv and .ods format, the columns must be titled \'In|Timecode\', \'Speaker|Speaker\' and \'Trans[c|k]ript|Translation|Translation\'. Files in .odt format should only contain the transcript text (including speaker markups) without headers, footers or other text.'),(6308,586,'el','2023-09-06 11:22:23.125885','2023-09-06 11:22:23.125885','Nutzeransicht'),(6309,587,'el','2023-09-06 11:22:23.130490','2023-09-07 17:00:27.487278','Editing interface'),(6310,588,'el','2023-09-06 11:22:23.135681','2023-09-06 11:22:23.135681','Εγγραφή'),(6311,589,'el','2023-09-06 11:22:23.140850','2023-09-06 11:22:23.140850','Παρακαλούμε εγγραφείτε για να αποκτήσετε πρόσβαση στις συνεντεύξεις. Οι '),(6312,590,'el','2023-09-06 11:22:23.146063','2023-09-06 11:22:23.146063','Παρακαλούμε εγγραφείτε για να μπορέσετε να χρησιμοποιήσετε την πλατφόρμα. Οι '),(6313,591,'el','2023-09-06 11:22:23.151226','2024-10-02 14:13:35.675500','εξηγούν από ποιον και για ποιους σκοπούς μπορεί να χρησιμοποιηθεί το Oral.History-Digital. Οι '),(6314,592,'el','2023-09-06 11:22:23.164787','2023-09-09 10:49:11.693506',' αναλύουν, για ποιους λόγους επεξεργαζόμαστε τα δεδομένα σας, και για ποιο σκοπό τα αξιοποιούμε. Για λόγους προστασίας δεδομένων, θα σας ζητηθεί να επιβεβαιώσετε την εγγραφή σας μέσω e-mail. '),(6315,593,'el','2023-09-06 11:22:23.169975','2023-09-06 11:22:23.169975','Στη συνέχεια, μπορείτε να ζητήσετε την ενεργοποίηση των διάφορων αρχείων μαρτυριών που περιλαμβάνονται στην πλατφόρμα.'),(6316,594,'el','2023-09-06 11:22:23.175106','2023-09-08 11:33:49.350988','Όροι χρήσης'),(6317,595,'el','2023-09-06 11:22:23.180266','2023-09-08 11:35:04.332435','Πολιτική προστασίας δεδομένων'),(6318,596,'el','2023-09-06 11:22:23.185413','2023-09-06 11:22:23.185413','Συμφωνώ με τις προϋποθέσεις χρήσης'),(6319,597,'el','2023-09-06 11:22:23.198795','2023-09-08 10:24:02.043203','όροι προστασίας προσωπικών δεδομένων'),(6320,598,'el','2023-09-06 11:22:23.204154','2023-09-08 11:08:30.577447','Συμφωνώ με 