55,1310,'uk','2024-05-22 13:47:42.793608','2024-05-22 14:43:20.827623','<p>Доброго дня %{user_display_name}, </p><p>Тепер ви маєте доступ до програми \'%{project_link}\' для вказаного вами дослідницького наміру.</p><p>Будь ласка, поважайте права співбесідників на конфіденційність та %{tos_link} архівом %{tos_link}.</p><p>З найкращими побажаннями </p><p>%{project_name}</p>'),(90410656,1721,'uk','2024-05-22 13:48:22.835155','2024-05-22 13:48:22.835155','Будь ласка, підтвердьте свою реєстрацію.'),(90410657,1312,'uk','2024-05-22 14:04:32.556187','2024-05-22 14:04:32.556187','<p>Доброго дня %{user_display_name}, </p><p>Ви надіслали запит на активацію програми \'%{project_name}\'. </p><p>На жаль, перевірка вашої інформації виявила, що вона недостатня або не відповідає %{tos_link}.</p><p>Ви можете скористатися наступним посиланням, щоб змінити або доповнити свою інформацію.</p><p>%{correct_link}p><p>Якщо вам потрібна допомога, будь ласка, зв’яжіться з нами за адресою %{mail_to}.</p><p>З найкращими побажаннями</p><p>%{project_name}</p>'),(90410658,1313,'uk','2024-05-22 14:04:59.441192','2024-05-22 14:04:59.441192','Підтвердити реєстрацію'),(90410659,1314,'uk','2024-05-22 14:20:15.305477','2024-05-22 14:20:15.305477','<p>Доброго дня %{user_display_name},</p><p>Повідомляємо, що доступ до програми \'%{project_name}\'заблоковано. Це відбувається, коли не дотримуються %{tos_link} архіву.</p><p>Якщо у вас виникнуть додаткові запитання, зв’яжіться з нами за адресою %{mail_to}.</p><p>З найкращими побажаннями</p><p>%{project_name}</p>'),(90410660,1315,'uk','2024-05-22 14:20:52.543945','2024-05-22 14:20:52.543945','Ваш доступ до програми \'%{project_name}\''),(90410661,1316,'uk','2024-05-22 14:25:07.140230','2024-05-22 14:25:07.140230','<p>Доброго дня %{user_display_name},</p><p>повідомляємо, що доступ до програми %{project_name} розблоковано.</p><p>Тепер ви знову можете отримати доступ до програми %{project_name}.</p><p>З найкращими побажаннями</p><p>%{project_name}</p>'),(90410662,